            "4. જે પહેલી છબી તમારે કૅપ્ચર કરવી છે તે ફોટોગ્રાફરનું ગ્રે કાર્ડ છે। કાર્ડને સમતલ સપાટી પર રાખો જે અણસંચિત હોય। સુનિશ્ચિત કરો કે કાર્ડ તે વિસ્તારમા છે જ્યાં તમે પાણીની છબી લેતા હો."),
        "instruction5": MessageLookupByLibrary.simpleMessage(
            "5. સુનિશ્ચિત કરો કે તમારી છાયા કાર્ડને ઢાંકતી નથી."),
        "instruction6": MessageLookupByLibrary.simpleMessage(
            "6. ગ્રે કાર્ડ અને પાણીની છબી માટે મોબાઈલનો ખૂણો 35 થી 55 ડિગ્રી હોવો જોઈએ, અને આકાશ માટે ખૂણો 125 થી 135 ડિગ્રી હોવો જોઈએ."),
        "instruction7": MessageLookupByLibrary.simpleMessage(
            "7. નીચેના ક્લિનોમીટરથી તમારે ફોટોગ્રાફ લેવા માટે સાચો ખૂણો જણાવવામાં આવશે। જ્યારે ખૂણો સાચો થશે, ત્યારે વર્તુળ ભરાઈ જશે, અને નীল બબલની બોર્ડર લાલ થઈ જશે。"),
        "instruction8": MessageLookupByLibrary.simpleMessage(
            "8. શ્રેષ્ઠ પરિણામો માટે, જો હાલના વિસ્તારો ઉપલબ્ધ હોય તો NIRનો ઉપયોગ કરો। જો નીચેના વિસ્તાર સંકોચી જાય છે, તો આ વિસ્તાર NIR માટે વધુ ઊંઘો છે。"),
        "instruction9": MessageLookupByLibrary.simpleMessage(
            "9. ત્રણ છબીઓ કૅપ્ચર કર્યા પછી, વિશ્લેષણ બટન પર ક્લિક કરી પરાવર્તકતા ડેટા ગણના અને પ્રદર્શિત થશે।"),
        "instructions_for_user":
            MessageLookupByLibrary.simpleMessage("ઉપરોક્તના માટે સૂચનાઓ"),
        "instructions_text": MessageLookupByLibrary.simpleMessage(
            "NEER એપ્લિકેશનનો ઉપયોગ પાણીની ગુણવત્તા નક્કી કરવા માટે થાય છે, જેમ કે FUI ઇન્ડેક્સ, ટર્બિડિટી, ક્લોરોફિલ અને SPM મૂલ્યનું માપન। આ પરિમાણો કેમેરા ક્લિકિંગ દ્વારા માપવામાં આવે છે, અને તાપમાન, pH, ઊંડાઈ, વિઘટિત ઓક્સિજન, વાહકતા અને સેકી ઊંડાઈ સાધનો દ્વારા માપવામાં આવે છે। તે પહેલાં, વપરાશકર્તાને GPS અથવા મેન્યુઅલ રીતે સ્થાન સુયોજિત કરવું પડે છે, અને તેના આધારે, અક્ષાંશ અને રેખાંશ મૂલ્ય સરળતાથી મેળવવામાં આવી શકે છે। પાણીના નિકાયની પસંદગી કર્યા પછી, વપરાશકર્તા તે સંબંધિત પરિમાણોની પસંદગી કરી શકે છે. FUI ઇન્ડેક્સ પાણીની છબી પકડીને પાણીના રંગ ઇન્ડેક્સની ગણતરી કરે છે। NEER સરળ ઉપયોગી ઇન્ટરફેસ ધરાવે છે જે વપરાશકર્તાઓને ત્રણ છબીઓ એકત્રિત કરવા માટે માર્ગદર્શિત કરે છે: ગ્રે કાર્ડ છબી, આકાશ છબી અને પાણીની છબી। NEER ને સંદર્ભ તરીકે 18% ફોટોગ્રાફરની ગ્રે કાર્ડની જરૂર હોય છે। ગ્રે કાર્ડ ફોટોગ્રાફી દુકાનો અને ઓનલાઈન વ્યાપકપણે ઉપલબ્ધ છે। એકવાર છબીઓ લેવામાં આવ્યા પછી, તેમને તરત જ વિશ્લેષણ કરી શકાય છે। છબીઓના વિશ્લેષણમાં, NEER RGB રંગ ચેનલોમાં પાણીના નિકાયના પરાવર્તનનું ગણતરી કરે છે। પછી તે પરાવર્તન મૂલ્યનો ઉપયોગ કરીને NTU (નેફેલોમેટ્રિક ટર્બિડિટી યુનિટ્સ) માં પાણીની ટર્બિડિટી નક્કી કરે છે। સેકી ડિસ્ક એક ગોળ સફેદ ડિસ્ક છે જે પાણીના નિકાયમાં મૂકી સેકી ઊંડાઈ નક્કી કરવામાં આવે છે, જે તે ઊંડાઈ છે જ્યાં સપાટી પરથી પાણીને જોઈ શકાય છે તે જોવા મળતું નથી. સેકી ઊંડાઈ પાણીની સ્વચ્છતાને માપે છે।"),
